import './App.css';

import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useRouteMatch,
  useParams
} from "react-router-dom";




function App() {
  return (

  <Router>
    <h1>Prueba</h1>

    <Route path="/ataque">
      <h1>ataque</h1>
    </Route>

    <Route path="/hola">
      <h1>Hola</h1>
    </Route>



  </Router>
  );
}


export default App;
